1. 本地存储1. 本地存储
localStorage

localStorage 允许你操作本地存储对象。localStorage与sessionStorage相似。唯一不同的是，localStorage中的数据没有时间限制，而对于sessionStorage，当浏览器会话结束(即浏览器关闭)时，sessionStorage中数据将被清除。


语法
myStorage = localStorage;

// 或 

myStorage = window.localStorage;

//localStorage是window的属性
值
一个Storage对象。
即 window.localStorage指向（是）一个 Storage对象，可以调用Storage的API接口方法进行数据操作。
示例
localStorage.setItem('myCat', 'Tom');
该脚本操作当前域的本地Storage对象，并通过Storage的setItem()方法添加了一个数据项。

sessionStorage

sessionStorage与localStorage基本相同，不同之处在于localStorage的数据不会过期，而sessionStorage中的数据在会话结束后被清除。页面会话在浏览器打开期间一直保持，并且重新加载或恢复页面仍会保持原来的页面会话。在新标签或窗口打开一个页面会初始化一个新的会话。


Storage

Storage接口提供了对会话存储(session storage)和本地存储(local storage)的操作，可以对存储数据项进行增、删、改操作。
Storage与对象一样，以键值对保存数据。key可以试字符串或整数，但value总是字符串。Storage可以像对象一样操作数据或者使用自身的接口方法。


Storage提供的属性和方法
属性

Storage.length (只读) 返回数据项的个数。

方法

storage.key(key)返回指定下标的key键值，参数key表示数据项在Storage中存储位置，整数(0,1,2...).

storage.getItem(keyName)获取指定键值名称keyName的value值。

storage.setItem(keyName, keyValue) 
新增属性或更新已存在的属性。

storage.removeItem(keyName) 
删除指定的属性。

Storage.clear() 
清空storage


检测浏览器是否支持Storage
function storageAvailable(type) {
    try {
        var storage = window[type],
            x = '__storage_test__';
        storage.setItem(x, x);
        storage.removeItem(x);
        return true;
    }
    catch(e) {
        return false;
    }
}
这个方法检测浏览器是否支持localStorage特性且是否可用。某些浏览器支持localStorage特性，但提供了不启用localStorage的设置。所以存在浏览器支持localStorage但不能在脚本中使用的情况。
使用：
if (storageAvailable('localStorage')) {
    // Yippee! We can use localStorage awesomeness
}
else {
    // Too bad, no localStorage for us
}

向storage设置值
function populateStorage() {
  localStorage.setItem('bgcolor', document.getElementById('bgcolor').value);
  localStorage.setItem('font', document.getElementById('font').value);
  localStorage.setItem('image', document.getElementById('image').value);

  setStyles();
}

从storage获取值
var htmlElem = document.querySelector('html');
var pElem = document.querySelector('p');
var imgElem = document.querySelector('img');

var bgcolorForm = document.getElementById('bgcolor');
var fontForm = document.getElementById('font');
var imageForm = document.getElementById('image');

function setStyles() {

  //从storage中获取值
  var currentColor = localStorage.getItem('bgcolor');
  var currentFont = localStorage.getItem('font');
  var currentImage = localStorage.getItem('image');

  //在页面中使用

  document.getElementById('bgcolor').value = currentColor;
  document.getElementById('font').value = currentFont;
  document.getElementById('image').value = currentImage;

  htmlElem.style.backgroundColor = '#' + currentColor;
  pElem.style.fontFamily = currentFont;
  imgElem.setAttribute('src', currentImage);
}

通过对象方式操作storage值
