StorageEvent事件：一旦Storage对象发生变化时，就会触发StorageEvent事件。但这个事件不会在当前发生变化的页面起作用，只作用于同域下的其他页面，并同步发生变化的Storage对象。不同域操作不同的Storage(Storage不能跨域共享).
