解析

在普通内容流中，margin:auto时，对应的margin-top,margin-bottom的值等于0
position:absolute;块元素脱离文档流
设置top:0;left:0;bottom:0;right:0;,重新设置块元素的盒子边界。此时，块元素会完全填充上级父元素的空间，该父元素可以是body或position:relative的容器。
设置块元素的宽度width或高度height,避免元素占据所有的可用空间，并迫使浏览器在新的盒子边界上计算margin:auto（此时对于margin-top和margin-bottom,值不再为0）
当块元素绝对定位并脱离文档流后，浏览器对margin-top和margin-bottom分配相等的值，从而达到垂直居中的效果。

