1. Javascript模块化编程1. Javascript模块化编程
CommonJS/CMD(Common Module Definition)


同步加载————对于浏览器，等待加载时间长，容易造成假死状态(服务器端)。  
CMD采用了服务器优先的策略，采取同步行为，且CMD模块只支持对象作为模块。


   var math = require('math');
   math.add(2,3);

返回一个模块对象通过该模块对象执行具体操作


AMD (Asynchronous Module Definition)


异步加载————模块加载不影响其他语句的执行。所以依赖该模块的语句，都定义在一个回调函数中，加载完成后，才执行回调函数。(客户端异步加载) 
AMD采用浏览器优先的方式来开发，选择了异步行为与简化的向后兼容性，但它完成没有文件I/O的概念。  
AMD支持对象、函数、构造器、字符串、JSON以及其他许多类型的模块，运行在浏览器本地环境之中。具有较好的灵活性。


require([module],callback);

第一个参数[module]是一个数组，里面的成员是要加载的模块,第二个参数callback，则是加载成功之后的回调函数。

require(['math'],function(math){
   math.add(2,3);    
})

实现AMD规范的js库主要有require.js和curl.js    


UMD (Universal Module Definition)


通用模块定义——UMD定义那些既能够在客户端又能在服务器端工作的模块，这样的模块同时也能和目前可用的主流脚本加载器一同工作。  
UMD可以说是CMD及AMD的混合模式require.js符合UMD规范。  



AMD 与 CMD的区别 

加载方式：AMD—— 异步加载；CMD—— 同步加载
使用环境：AMD—— 浏览器优先；CMD—— 服务器优先
模块定义：AMD—— 比较灵活；CMD—— 模块只能是对象
对于依赖模块：AMD—— 提前执行；CMD—— 延迟执行(as lazy as possible)
模块加载：AMD—— 依赖前置；CMD—— 依赖就近

// CMD
define(function(require, exports, module) {

    var a = require('./a')  
    a.doSomething()   
    // ....   

    var b = require('./b') 
    // 依赖可以就近书写   
    b.doSomething()   
    // ... 
})
// AMD 默认推荐的是
define(['./a', './b'], function(a, b) { // 依赖必须一开始就写好   

    a.doSomething()    
    // .....

    b.doSomething()    
    ...
})
