1. jQuery插件开发1. jQuery插件开发
1. 创建一个基础插件
$$插件的意义：$$ 通过jQuery选择器调用插件中一个或多个方法，以对该选择器进行一系列操作。插件的好处在于能够在代码中复用。
2. jQuery工作机制：jQuery对象方法
$( "a" ).css( "color", "red" );
当使用$函数来选择元素时，将返回一个jQuery对象。这个对象包含了所有jQuery提供的方法及所有匹配该选择器的元素。这些jQuery方法都来自于$.fn对象，这个对象包含了所有jQuery对象方法，所以，如果我们想自定义方法，则在该对象上定义即可。
3. 编写基础插件
$.fn.greenify = function() {
    this.css( "color", "green" );
};
$( "a" ).greenify(); // Makes all the links green.
4. 支持链式
在所有jQuery对象方法中都返回一个初始的jQuery对象，可以实现jQuery的链式特性。
$.fn.greenify = function() {
    this.css( "color", "green" );
    return this;
}
$( "a" ).greenify().addClass( "greenified" );
5. 保护$别名并添加作用域
在代码开发中，如果需要使用多个Javascript库，就存在命名冲突的情况。jQuery中可以通过jquery.noConflict()方法来取消对$别名的使用，但对于很多以$别名的插件，则会产生影响。可以通过立即执行函数解决这个问题。如下：
(function ( $ ) {

    $.fn.greenify = function() {
        this.css( "color", "green" );
        return this;
    };

}( jQuery ));
即定义一个以$命名参数的函数，并立即执行且以jQuery对象作为参数。
NOTE： 立即执行函数的最初目的是，允许函数包含私有变量。
(function ( $ ) {

    var shade = "#556b2f";

    $.fn.greenify = function() {
        this.css( "color", shade );
        return this;
    };

}( jQuery ));
    6. 最小化插件
一般情况下，一个插件最好就包含一个$.fn对象：减少你的插件被其他插件覆盖或覆盖其他插件的可能性。不提倡下面的写法：
(function( $ ) {

    $.fn.openPopup = function() {
        // Open popup code.
    };

    $.fn.closePopup = function() {
        // Close popup code.
    };

}( jQuery ));
比较好的方式。
(function( $ ) {

    $.fn.popup = function( action ) {

        if ( action === "open") {
            // Open popup code.
        }

