1. Grunt1. Grunt

Grunt的介绍和使用  

 下载安装 nodejs 

这里假设系统已经安装了NodeJs环境。

 安装 grunt CLI 
    npm install -g grunt-cli


这条命令将grunt命令设置到系统路径，以便在系统中任何目录，通过grunt运行项目。


创建 grunt项目 
package.json和Gruntfile.js是Grunt项目的必备文件。  

package.json：配置项目元数据及grunt和grunt插件。
Gruntfile.js：配置或定义任务和加载Grunt插件。
package.json和Gruntfile.js需位于项目的同级目录中。  

运行 grunt项目 

打开命令行终端，进入项目路径并执行：npm install。这条命令的作用是加载/下载packag.json中指定的插件或元数据。
在命令行终端执行 grunt命令，开始执行任务。


 package.json和Gruntfile.js的配置
